<template>
  GameID : {{ id }} : 
  <UButton icon="i-heroicons-clipboard-document" color="gray" @click="copyToClipboard">Game ROOM URLをコピー</UButton>
  <UButton @click="result" :disabled="isResultEmpty">結果を表示</UButton>
  <h2>お題</h2>
  <div>
    画像URL：
    <UInput v-model="imageUrl" />
    <UButton @click="createTitle" :disabled="isInputEmpty">取得</UButton>
  </div>
  <div>
    <img :src="titleImg" width="512" />
  </div>
  <div>
    <UTextarea v-model="prompt" />
    <UButton @click="createImage">画像を生成</UButton>
    <UButton @click="clear">クリア</UButton>
  </div>
  <div>
    <img :src="genImage" />
    ニックネーム：<UInput v-model="nickname" />
    <UButton @click="shareImage">画像を共有</UButton>
  </div>
</template>
  
<script lang="ts" setup>
import { useRoute } from 'vue-router';
import { ref, computed, onMounted } from 'vue';

const route = useRoute();

const id = route.params.id as string;

const imageUrl = ref<string>('');
const titleImg = ref<string>('');
const isInputEmpty = ref<boolean>(false);
const isResultEmpty = ref<boolean>(true);

const prompt = ref<string>('');
const genImage = ref<string>('');
const nickname = ref<string>('');


// 現在のページの完全なURLを取得
const currentUrl = computed(() => {
  return window.location.origin + route.fullPath;
});

// コンポーネントがマウントされたときに実行
onMounted(async () => {
  // Gameの内容を取得
  const { data, error } = await useFetch(`/api/games/${id}`);
  if (error.value) {
    console.error(error.value);
    // TODO エラー画面に遷移させる
    return;
  }
  const game = data.value as Game;
  imageUrl.value = game.titleUrl;
  titleImg.value = game.titleImage;
  isInputEmpty.value = game.titleUrl.trim() !== '';
});

// クリップボードに値をコピーする
const copyToClipboard = async () => {
  if (navigator.clipboard) {
    // Clipboard APIを使用してテキストをクリップボードにコピー
    try {
      await navigator.clipboard.writeText(currentUrl.value);
      console.log('Copied to clipboard');
    } catch (err) {
      console.error('Failed to copy: ', err);
    }
  }
};

// お題の画像を作成
const createTitle = async () => {
  //画像を取得する
}

const createImage = async () => {
  console.log(prompt.value);
  genImage.value = "data:image/jpg;base64,";
}

const shareImage = async () => {
  console.log(nickname.value);
  console.log(genImage.value);
  console.log(prompt.value);
  genImage.value = '';
  prompt.value = '';
}

const clear = async () => {
  genImage.value = '';
  prompt.value = '';
}

const result = async () => {
  navigateTo('/result/' + id);
}

type Game = {
    gameId: string;
    titleUrl: string;
    titleImage: string;
}
</script>
